;; @@
(let [sds (->> lat (partition 1000) (map stat/sd))
      means (->> lat (partition 1000) (map stat/mean))] 
  (gg4clj/view 
  [[:<- :d (gg4clj/data-frame 
             {:commits_in_1000 (range (count means))
              :mean_latency_in_ms means  
              :sd_min (map - means sds)
              :sd_max (map + means sds)})]
  (gg4clj/r+ [:ggplot :d [:aes {:x :commits_in_1000 :y :mean_latency_in_ms}]]
             [:xlab "commits in 1000"]
             [:ylab "mean latency in ms"]
             [:geom_line {}]
             [:geom_point {}]
             [:geom_errorbar [:aes {:ymin :sd_min :ymax :sd_max}]])]
  {:width 6}))
